INSERT INTO `plants` (`id`, `name`, `latin_name`, `description`, `watering_period`, `watering_amount`, `link_wiki`, `slika`) VALUES
	(1, 'Aloe vera (Aloja)', 'Aloe barbadensis miller', 'Le kdo ne pozna te sočnice (sukulenta) z zdravilno močjo, katere ime se pojavlja že na papirusih iz časa starih Egipčanov in je vso zgodovino prisotna v lekarništvu? Akne, opekline, splošno zdravje ...\r\n\r\nVsebuje vitamine A, B (B1, B2, B3, B6, B9 in B12), C in E. Je vir folne kisline. Prav tako vsebuje številne minerale in antioksidante, encime (16), aminokisline, krepila naj bi imunski sistem in delovala antibakterijsko ter protivirusno.', 20, 50, 'https://sl.wikipedia.org/wiki/Aloe_vera', ''),
	(2, 'Kaktus', 'Cactaceae', 'Ko kaktusi zacvetijo, naj bi imeli skorajda magično moč, da izboljšajo naše življenje in spodbujajo komunikacijo in razumevanje med ljudmi.\r\n\r\nSo družina rastlin, ki je razširjena le v severni in južni Ameriki.\r\n\r\nKer v starem svetu ne najdemo kaktusov – na ozko razširjenost kaktusov je očitno vplivala že ločitev Ameriške plošče od Evrazijske, ugotovimo, da so zelo mlada družina, ki naj bi se razvila pred 40 milijoni let.', 180, 45, 'https://sl.wikipedia.org/wiki/Kaktusi', ''),
	(3, 'Bananovec', 'Musa acuminata', 'Bananovec je rod večletnih rastlin tropskega izvora. \r\n\r\nSteblo ali bolj pravilno imenovno »pseudosteblo« kjer listi tvorijo rozeto ki se samodejno podpira. \r\nV vegetacijskem obdobju raste bananovec skupaj z obilico stranskih (hčerinskih) poganjkov. \r\nStranski poganjki se odstranjujejo zaradi koncentriranja hranil v starševski rastlini.\r\n\r\nPri vzgajanju se načrtno odbira ustrezni stranski poganjek za naslednjo rastno sezono po obliki listov in vigorju.\r\n \r\nPo videzu bananovci spominjajo na palmo. Obstaja več sto različnih vrst bananovcev. Njihov plod je banana. ', 1, 100, 'https://sl.wikipedia.org/wiki/Bananovec', ''),
	(4, 'Orhideja', 'Orchidaceae', 'Družina orhidej je zelo velika; znanih je več kot 30.000 vrst, ki uspevajo v vseh klimatskih pasovih, razen Arktike, Antarktike in v visokogorjih, kjer je ledena klima.\r\nV Sloveniji raste okoli 60 vrst zemeljskih orhidej, v vrtnih centrih pa lahko kupimo tudi številne hibride, ki izhajajo iz samega rodu, pa tudi križance med različnimi rodovi orhidej.', 5, 30, 'https://sl.wikipedia.org/wiki/Kukavi%C4%8Devke', ''),
	(5, 'Živkasta kosmuljka ali zelenčica', 'Chlorophytum comosum', 'Njeni upognjeni tanki listi spominjajo na pajkove noge, zato ji ponekod rečejo tudi pajkovka. \r\n\r\nZadnje čase zopet postaja bolj popularna, najlepše pa pride do izraza v visečem loncu.\r\n\r\nUspeva v srednje vlažni zemlji, na svetlem do srednje svetlem mestu ter temperaturi med 16 in 23 stopinj C.', 3, 35, 'https://en.wikipedia.org/wiki/Chlorophytum_comosum', ''),
	(6, 'Navadni bršljan', 'Hedera helix', 'Ta bršljan ima prirojeno eleganco, najlepši učinek dosežete, če ga postavite na višje mesto in se spušča po pohištvu. Zelo enostavno ga je tudi razmnoževati.\r\n\r\nRad ima vlažno zemljo in nižjo sobno temperaturo – od 13 do 21 stopinj C.\r\n\r\nPogani so v preteklosti bršljan uporabljali pri različnih obredih, pripisovali pa so mu tudi čarobno moč. ', 7, 40, 'https://sl.wikipedia.org/wiki/Navadni_br%C5%A1ljan', ''),
	(7, 'Lirasti fikus', 'Ficus lyrata', 'Ima velike svetleče liste in prinese veselje v vsak prostor – doma ali v pisarni. \r\n\r\nNjegovi listi rastejo skoraj vodoravno iz stebla in nekoliko spominjajo na glasbilo liro (od tod njegovo ime).\r\n\r\nTo drevo ima rado veliko sonca. Kadar ga zalivate, naredite to obilno, sicer pa pustite, da se zemlja med dvema zalivanjema posuši.', 4, 100, 'https://sl.wikipedia.org/wiki/Lirastolisti_fikus', ''),
	(8, 'Bambusova palma', 'Chamaedorea seifrizii', 'Sanjate o tropskih krajih? Potem vas bo pogled na to rastlino v trenutku ponesel tja. Zraste lahko do 2 metrov in prinese dramatičen učinek v prostor. Če imate rajši manjšo, jo posadite v manjši lonec, kjer se ne bo tako razbohotila.\r\n\r\nDobro uspeva na nedirektni svetlobi. Zalivajte jo vsak drugi teden.', 14, 150, 'https://en.wikipedia.org/wiki/Bamboo', '');
INSERT INTO `plants` (`id`, `name`, `latin_name`, `description`, `watering_period`, `watering_amount`, `link_wiki`, `slika`) VALUES
	(9, 'Miltonija', 'Miltonia spectabilis', 'Ta barvita cvetlica ima visoke standarde, ki pa jim boste s svojo osredotočenostjo zagotovo kos. Miltonija najraje uživa na sončni, a ne direktni svetlobi. \r\n\r\nPotrebuje vlažni habitat, prav tako pa ji hitro postane dolgčas. \r\n\r\nPresaditi jo je potrebno vsakih nekaj let. Dobro se počuti, če temperatura ne presega 26 stopinj. Potrebuje pravočasno zalivanje in gnojenje.', 3, 50, 'https://en.wikipedia.org/wiki/Miltonia', ''),
	(10, 'Gardenija', 'Gardenia jasminoides', 'Aromo gardenije dodajajo številnim dišavam. Rahlo sladkast vonj, ki napolni prostor, vas lahko razveseljuje tudi več mesecev, ko ta prečudovita rastlina cveti.\r\n\r\nPostavite jo na svetlobo in ji privoščite dovolj tekočine enkrat tedensko.', 7, 70, 'https://en.wikipedia.org/wiki/Gardenia', ''),
	(11, 'Mavrina', 'Epipremnum aureum', 'Do kar 8 metrov v dolžino zraste mavrina ali potos, a njeno rast lahko nadzorujete s striženjem vršičkov. \r\n\r\nJe povsem nezahtevna rastlina, zalijete jo, ko je zemlja suha. Ne potrebuje veliko svetlobe.\r\n\r\n Iz zraka odstranjuje celo vrsto strupenih snovi, ima pa eno pomanjkljivost - je strupena za živali.', 14, 80, 'https://en.wikipedia.org/wiki/Epipremnum_aureum', ''),
	(12, 'Gumovec', 'Ficus elastica', 'Gumovec ima rad svetlobo in vlažno zemljo, zato ga moramo zmerno zalivati, poleti dvakrat, pozimi pa enkrat na teden. \r\n\r\nPoleg tega moramo brisati njegove lepe liste. Če boste to storili s krpo, navlaženo z mlekom, bodo dobili lep lesk. \r\n\r\nIz zraka odstranjuje formaldehid in trikloroetilen, žal pa je strupen za živali.', 10, 85, 'https://en.wikipedia.org/wiki/Ficus_elastica', '');

